window.bookSummaryJSON = "<p>The mythical Venus helps a nerdy woman find her own inner goddess in this novel in <i>New York Times </i>best-selling author P. C. Cast's Goddess Summoning series. </p> <p>Pea Chamberlain needs a makeover - shoes, hair, clothes, make-up, everything - especially if she wants to attract sexy fireman Griffin DeAngelo at the fireman's masked ball. And there's no one better suited to coax Pea out of her pod than the Goddess of Love, whom she invokes in a moment of desperation. </p> <p>After eons of helping others find love, Venus has no problem working her magic on Pea. But when the goddess herself starts falling head over heels for Griffin, it will take an act of divine intervention to set this love triangle to rights. </p>"; 
